import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import CategoryPage from './pages/CategoryPage';
import { WebGazerProvider } from './hooks/WebGazerContext'; // ใช้ WebGazerProvider
import './App.css';

const TestSidebar = () => (
  <div className="app-container">
    <Sidebar />
  </div>
);

const TestCategoryPage = () => (
  <div className="app-container">
    <CategoryPage id="หน้าหลัก" />
  </div>
);

const App = () => {
  return (
    <WebGazerProvider>
      <Router>
        <Routes>
          <Route path="/test-sidebar" element={<TestSidebar />} />
          <Route path="/test-category" element={<TestCategoryPage />} />
          <Route path="/" element={<CategoryPage id="หน้าหลัก" />} />
          <Route path="/category/:id" element={<CategoryPage />} />
        </Routes>
      </Router>
    </WebGazerProvider>
  );
};

export default App;
